import React from "react";

class UserClass extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: "dummy",
            location: "dummy"
        };
    }

    async componentDidMount(){
        // console.log(this.props.name +" Child component did mount");
        const userData = await fetch("https://api.github.com/users/pradneshbhike");
        console.log(userData.json());
    }

    render(){
        // console.log(this.props.name +" child render method");
        const { name, location } = this.props;
        // const { count, count2 } = this.State;
        return(
            <div>
                <h1>class</h1>
                <h1>count = : {this.state.count}</h1>
                {/* <h1>"count2 = ": {count2}</h1> */}

                <button onClick={()=> {this.setState({count: this.state.count+1})}}>Increase Count</button>
                <h1>{name}</h1>
                <h1>{location}</h1>
            </div>
        )
    }
} 

export default UserClass;
